import "../Detail.css"

const Activity = ({name, difficult, duration, season}) => {
    return(
        <div className="Activity">
            <h1 className="actName">Activity</h1>
            <h2>Name: {name}</h2>
            <h2>Difficulty: {difficult}</h2>
            <h2>Duration: {duration}</h2>
            <h2>Season: {season}</h2>
        </div>
    )
}

export default Activity;
